    XW += x[23]*27.046210; /*C2H3 */
    XW += x[24]*28.054180; /*C2H4 */
    XW += x[25]*29.062150; /*C2H5 */
    XW += x[26]*30.070120; /*C2H6 */
    XW += x[27]*41.029670; /*HCCO */
    XW += x[28]*42.037640; /*CH2CO */
    XW += x[29]*42.037640; /*HCCOH */
    XW += x[30]*14.006700; /*N */
    XW += x[31]*15.014670; /*NH */
    XW += x[32]*16.022640; /*NH2 */
    XW += x[33]*17.030610; /*NH3 */
    XW += x[34]*29.021370; /*NNH */
    XW += x[35]*30.006100; /*NO */
    XW += x[36]*46.005500; /*NO2 */
    XW += x[37]*44.012800; /*N2O */
    XW += x[38]*31.014070; /*HNO */
    XW += x[39]*26.017850; /*CN */
    XW += x[40]*27.025820; /*HCN */
    XW += x[41]*28.033790; /*H2CN */
    XW += x[42]*41.032520; /*HCNN */
    XW += x[43]*43.025220; /*HCNO */
    XW += x[44]*43.025220; /*HOCN */
    XW += x[45]*43.025220; /*HNCO */
    XW += x[46]*42.017250; /*NCO */
